import React from "react";
import cities from './city-weather.json';


function CityList({cities}){

    return (
        <div>
            {cities.map(city=>{
                <City name={city.name}/>
            })}
        </div>
    )
}

function City({props}){
    return(
        <div class="card">
            <h2>{props.Name}</h2>
        </div>
    )

}

export default CityList;
